column8:
メーカー希望小売価格はメーカーカタログに基づいて掲載しています<br>
【バストアップブラ】<br>
伸縮性のある素材がバストアップをサポート！<br>
見せブラとしても使えます。<br>

1、Vバックタイプで寄せ上げ効果。<br>
2、下厚PitカップがバストUP。<br>
3、はみ肉を逃さないパワーネット採用。<br>
見せブラで可愛くコーディネート。 <br>

素材：綿95%、ポリウレタン5%（パワーネット：ナイロン90%、ポリウレタン10%）<br>
<br>
サイズ：<br>
M　79～86cm<br>
L　87～96cm<br>
<br>
→
補正下着 カテゴリ←<br>
→
ポイント10倍 セール会場←
<br>
→
送料無料 セール会場←
